import React from "react";
import "./Rules.css";

function About() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Om oss</h1>
      <div className="rules-container text-break">
        <p>
          Kumla Sportfiskeförening är en ideell förening som arbetar för att främja sportfiske
          och vårda våra sjöar. Vi arrangerar kurser, fiskeäventyr och medlemsaktiviteter under året.
          <br /><br />
          Våra sjöar inkluderar Lugnet, Säbylundssjön och flera medlemssjöar där vi erbjuder olika
          fiskemöjligheter för både nybörjare och erfarna fiskare.
        </p>
      </div>
    </div>
  );
}

export default About;
